DROP TABLE IF EXISTS `movies`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `movies` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `image_id` int(10) unsigned DEFAULT NULL,
  `afisha_id` int(10) unsigned DEFAULT NULL,
  `country_id` int(10) unsigned DEFAULT NULL,
  `genre_id` int(10) unsigned DEFAULT NULL,
  `trailer_id` int(10) unsigned DEFAULT NULL,
  `filename` varchar(250) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `year_create` year(4) DEFAULT NULL,
  `budget` int(10) unsigned NOT NULL,
  `premiera` datetime DEFAULT CURRENT_TIMESTAMP,
  `age_limitation` int(10) unsigned NOT NULL,
  `duration` int(10) unsigned NOT NULL,
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `movies_image_id_fk` (`image_id`),
  KEY `movies_afisha_id_fk` (`afisha_id`),
  KEY `movies_country_id_fk` (`country_id`),
  KEY `movies_genre_id_fk` (`genre_id`),
  KEY `movies_trailer_id_fk` (`trailer_id`),
  CONSTRAINT `movies_afisha_id_fk` FOREIGN KEY (`afisha_id`) REFERENCES `afisha` (`id`) ON DELETE SET NULL,
  CONSTRAINT `movies_country_id_fk` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`) ON DELETE SET NULL,
  CONSTRAINT `movies_genre_id_fk` FOREIGN KEY (`genre_id`) REFERENCES `genres` (`id`) ON DELETE SET NULL,
  CONSTRAINT `movies_image_id_fk` FOREIGN KEY (`image_id`) REFERENCES `images` (`id`) ON DELETE SET NULL,
  CONSTRAINT `movies_trailer_id_fk` FOREIGN KEY (`trailer_id`) REFERENCES `trailers` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='страница описания фильма';
/*!40101 SET character_set_client = @saved_cs_client */;

